const API={async getLastWorkout(){let a;try{a=await fetch("/api/workouts")}catch(a){console.log(a)}const b=await a.json();return b[b.length-1]},async addExercise(a){const b=location.search.split("=")[1],c=await fetch("/api/workouts/"+b,{method:"PUT",headers:{"Content-Type":"application/json"},body:JSON.stringify(a)}),d=await c.json();return d},async createWorkout(a={}){const b=await fetch("/api/workouts",{method:"POST",body:JSON.stringify(a),headers:{"Content-Type":"application/json"}}),c=await b.json();return c},async getWorkoutsInRange(){const a=await fetch(`/api/workouts/range`),b=await a.json();return b}};